import React from 'react';


export default class GenesisWinner extends React.Component {
    render() {
        return (
            <div className="container-fluid text-left">
                <div className="row">
                    <div className="col-12">
                        <p className="genesis-top font-weight-500">
                            {this.props.title}
                        </p>
                    </div>
                </div>
                <div className="row">
                    <div className="col-12">
                        <div className={"border-bottom-genesis"}>

                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col-12">
                        <div className="title-small-block-text-genesis">
                            {this.props.description}
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
